import { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';

function TeamForm({ baseURI, pokemons, error, setError, getSpriteURL }) {
  const [members, setMembers] = useState([]);
  const [submitDisable, setSubmitDisable] = useState(false);

  const defaultState = {
    name: '',
    member01: '',
    member02: '',
    member03: '',
    member04: '',
    member05: '',
    member06: '',
  };

  const [inputState, setInputState] = useState(defaultState);

  const findBySpecies = async (species) => {
    try {
      const response = await fetch(baseURI, {
        method: 'POST',
        headers: {
          'Content-type': 'application/json',
        },
        body: JSON.stringify(breed),
      });
      console.log(response);
    } catch (e) {
      error = e.message;
      setError(error);
    }
  };

  const handleInputChange = (input, value) => {
    const newInputState = { ...inputState, [input]: value };
    setInputState(newInputState);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    if (inputState.member01.length > 0) {
      findBySpecies(inputState.member01);
    }
    if (inputState.member02.length > 0) {
      findBySpecies(inputState.member02);
    }
    if (inputState.member03.length > 0) {
      findBySpecies(inputState.member03);
    }
    if (inputState.member04.length > 0) {
      findBySpecies(inputState.member04);
    }
    if (inputState.member05.length > 0) {
      findBySpecies(inputState.member05);
    }
    if (inputState.member06.length > 0) {
      findBySpecies(inputState.member06);
    }
    console.log(members);
  };

  return (
    <>
      <Form onSubmit={handleSubmit}>
        <Form.Group className='mb-3' controlId='name'>
          <Form.Control
            type='text'
            value={inputState.name}
            placeholder='Enter the team name'
            onChange={(event) => {
              console.log(event.target.value);
              handleInputChange(event.target.id, event.target.value);
            }}
          />
        </Form.Group>

        <div className='m-3'>
          {members.map((member) => (
            <span key={member.dexNumber} className='mx-2'>
              <img
                src={getSpriteURL(member.species)}
                className='border border-dark rounded'
                alt='pokeSprite'
              />
            </span>
          ))}
        </div>

        <Form.Group className='mb-3' controlId='member01'>
          <Form.Control
            type='text'
            value={inputState.member01}
            placeholder='Enter a pokemon'
            onChange={(event) => {
              console.log(event.target.value);
              handleInputChange(event.target.id, event.target.value);
            }}
          />
        </Form.Group>

        <Form.Group className='mb-3' controlId='member02'>
          <Form.Control
            type='text'
            value={inputState.member02}
            placeholder='Enter a pokemon'
            onChange={(event) => {
              console.log(event.target.value);
              handleInputChange(event.target.id, event.target.value);
            }}
          />
        </Form.Group>

        <Form.Group className='mb-3' controlId='member03'>
          <Form.Control
            type='text'
            value={inputState.member03}
            placeholder='Enter a pokemon'
            onChange={(event) => {
              console.log(event.target.value);
              handleInputChange(event.target.id, event.target.value);
            }}
          />
        </Form.Group>

        <Form.Group className='mb-3' controlId='member04'>
          <Form.Control
            type='text'
            value={inputState.member04}
            placeholder='Enter a pokemon'
            onChange={(event) => {
              console.log(event.target.value);
              handleInputChange(event.target.id, event.target.value);
            }}
          />
        </Form.Group>

        <Form.Group className='mb-3' controlId='member05'>
          <Form.Control
            type='text'
            value={inputState.member05}
            placeholder='Enter a pokemon'
            onChange={(event) => {
              console.log(event.target.value);
              handleInputChange(event.target.id, event.target.value);
            }}
          />
        </Form.Group>

        <Form.Group className='mb-3' controlId='member06'>
          <Form.Control
            type='text'
            value={inputState.member06}
            placeholder='Enter a pokemon'
            onChange={(event) => {
              console.log(event.target.value);
              handleInputChange(event.target.id, event.target.value);
            }}
          />
        </Form.Group>

        <div className='text-center'>
          <Button
            variant='primary'
            type='submit'
            id='btnSubmit'
            disabled={submitDisable}>
            Submit
          </Button>
        </div>
      </Form>
    </>
  );
}

export default TeamForm;
